  return (
    <div>
      <div>
        <h1>Movie List</h1>
      </div>

      <table>
        <thead>
          <tr>
            <th>Title</th>
            <th>Year</th>
            <th>Director</th>
            <th>Rating</th>
            <th>Category</th>
          </tr>
        </thead>
        <tbody>
          {MovieData.map((movie) => (
            <tr>
              <td>{movie.Title}</td>
              <td>{movie.Year}</td>
              <td>{movie.Director}</td>
              <td>{movie.Rating}</td>
              <td>{movie.Category}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default MovieInfo;
